import React from 'react';

const Widget = ({ title, temperature, windSpeed, city }) => {


    return (
        <table className="ui two very basic column table">
            <tbody>
                <tr>
                    <td>
                        <h5>{title}</h5>
                    </td>
                </tr>
                <tr>
                    <td>
                        temp:{temperature}
                        <br />
                        city:{city}
                    </td>
                    <td>
                        wind:{windSpeed ? windSpeed : 'none'}
                    </td>
                </tr>
            </tbody>
        </table>
    );
};

export default Widget;
